import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Connection, PublicKey } from '@solana/web3.js';

const HELIUS_RPC = 'https://mainnet.helius-rpc.com/?api-key=d8d8052a-72db-4652-8942-9ae97f24cdec';
const METEORA_API = 'https://dlmm-api.meteora.ag';

const connection = new Connection(HELIUS_RPC, {
  commitment: 'confirmed',
  confirmTransactionInitialTimeout: 60000,
});

function App() {
  const [walletAddress, setWalletAddress] = useState('');
  const [transactions, setTransactions] = useState([]);
  const [liquidityPositions, setLiquidityPositions] = useState([]);
  const [totals, setTotals] = useState({ deposits: 0, withdrawals: 0, claimedFees: 0 });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const fetchTransactions = async () => {
    setLoading(true);
    setError('');
    try {
      const pubkey = new PublicKey(walletAddress);
      const signatures = await connection.getSignaturesForAddress(pubkey);
      const txs = await Promise.all(
        signatures.map(sig => 
          connection.getParsedTransaction(sig.signature, {
            maxSupportedTransactionVersion: 0
          })
        )
      );
      setTransactions(txs.filter(tx => tx !== null));
    } catch (err) {
      setError('Error fetching transactions: ' + err.message);
    } finally {
      setLoading(false);
    }
  };

  const isMeteoraOrHawksightTx = (tx) => {
    // This is a placeholder. You'll need to implement the actual logic
    // to determine if a transaction is related to Meteora or Hawksight
    return tx.transaction.message.accountKeys.some(key => 
      key.pubkey.toString() === 'METEORA_PROGRAM_ID' || 
      key.pubkey.toString() === 'HAWKSIGHT_PROGRAM_ID'
    );
  };

  const getPositionAddress = (tx) => {
    // This is a placeholder. You'll need to implement the actual logic
    // to extract the position address from the transaction
    return tx.transaction.message.accountKeys[0].pubkey.toString();
  };

  const fetchPositionInfo = async (positionAddress) => {
    try {
      const response = await axios.get(`${METEORA_API}/position/${positionAddress}`);
      return response.data;
    } catch (err) {
      console.error('Error fetching position info:', err);
      return null;
    }
  };

  const analyzeLiquidityPositions = async () => {
    setLoading(true);
    setError('');
    try {
      const liquidityTxs = transactions.filter(isMeteoraOrHawksightTx);
      const positions = await Promise.all(
        liquidityTxs.map(async tx => {
          const positionAddress = getPositionAddress(tx);
          return await fetchPositionInfo(positionAddress);
        })
      );
      setLiquidityPositions(positions.filter(p => p !== null));

      const newTotals = positions.reduce((acc, position) => {
        if (position) {
          acc.deposits += position.totalDeposits || 0;
          acc.withdrawals += position.totalWithdrawals || 0;
          acc.claimedFees += position.totalClaimedFees || 0;
        }
        return acc;
      }, { deposits: 0, withdrawals: 0, claimedFees: 0 });
      setTotals(newTotals);
    } catch (err) {
      setError('Error analyzing positions: ' + err.message);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (walletAddress) {
      fetchTransactions();
    }
  }, [walletAddress]);

  return (
    <div>
      <h1>Wallet Transaction Analyzer</h1>
      <input
        type="text"
        value={walletAddress}
        onChange={(e) => setWalletAddress(e.target.value)}
        placeholder="Enter wallet address"
      />
      <button onClick={analyzeLiquidityPositions} disabled={loading || !transactions.length}>
        Analyze
      </button>
      {loading && <p>Loading...</p>}
      {error && <p style={{color: 'red'}}>{error}</p>}
      {!loading && !error && (
        <div>
          <h2>Results:</h2>
          <p>Total Deposits: {totals.deposits}</p>
          <p>Total Withdrawals: {totals.withdrawals}</p>
          <p>Total Claimed Fees: {totals.claimedFees}</p>
          <h3>Liquidity Positions:</h3>
          <ul>
            {liquidityPositions.map((position, index) => (
              <li key={index}>
                Position Address: {position.address}, 
                Deposits: {position.totalDeposits}, 
                Withdrawals: {position.totalWithdrawals}, 
                Claimed Fees: {position.totalClaimedFees}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default App;
